import Link from 'next/link';

const linkStyle = {
  marginRight: 15
};

const Header = () => (
  <div className="container-fluid">
    <ul className="navbar-nav">
      <Link href="/">
        <a style={linkStyle}>Les recettes de Martine</a>
      </Link>
      <Link href="/about">
        <a style={linkStyle}>About</a>
      </Link>
    </ul>
  </div>
);

export default Header;
